import logo from './logo.svg';
import './App.css';
import Perfil from './componentes/perfil.js';

function App() {
  return (
    <div className="App">
      <div class = 'contenedor-princial'>
        <h1>Mis desarrolladores favoritos son</h1>
        <Perfil
          nombre ='Brais Moure'
          pais ='España'
          imagen ='brais'
          cargo='Ingeniero de software'
          empresa='MoureDev'
          perfil='Es un youtuber español, es el fundador de la empresa de MoureDev'

        />
      </div>
    </div>
  );
}

export default App;
